%[text] # fise\_humanLSF
%[text] Illustrate the human line spread function at different wavelengths. The purpose is to show the very large longitudinal chromatic aberration of the human eye, and to illustrate the linespread.
%[text] This script requires ISETBio on your path so that we can access the human Lens object.
%[text] We use the wavefront human optics model from Larry Thibos' average subject.  
%[text] See also:
%[text]  s\_humanLSF, t\_humanLineSpreadOI
%%
%[text] ## Initialize ISETCam/ISETBio
ieInit
%%
%[text] ## Create a broadband line
imSize = 512;
scene = sceneCreate('lineee',imSize);     % D65 SPD for a thin line
scene = sceneSet(scene,'fov',0.5);  % Small field of view
ieAddObject(scene);
% sceneWindow;
%%
%[text] ## Make scenes for several different wavelengths
scene425 = sceneInterpolateW(scene,425);
scene525 = sceneInterpolateW(scene,525);
scene625 = sceneInterpolateW(scene,625);
%%
%[text] ## Run the optical calculation for each of the lines
rgb = cell(4,1);

% The values are slightly different.
oi = oiCreate('human');
oi = oiCompute(oi,scene);
oi = oiSet(oi,'name','line-d65');
rgb{1} = oiGet(oi,'rgb');  % Store the image
support{1} = oiGet(oi,'spatial support linear','um');
% oiWindow(oi);

oi = oiCreate('human');
oi = oiCompute(oi,scene425);
oi = oiSet(oi,'name','line-425');
rgb{2} = oiGet(oi,'rgb');  % Store the image
support{2} = oiGet(oi,'spatial support linear','um');
% oiWindow(oi);

oi = oiCreate('human');
oi = oiCompute(oi,scene525);
oi = oiSet(oi,'name','line-525');
rgb{3} = oiGet(oi,'rgb');  % Store the image
support{3} = oiGet(oi,'spatial support linear','um');
% oiWindow(oi);

oi = oiCreate('human');
oi = oiCompute(oi,scene625);
oi = oiSet(oi,'name','line-625');
rgb{4} = oiGet(oi,'rgb');  % Store the image
support{4} = oiGet(oi,'spatial support linear','um');
% oiWindow(oi);
%%
%[text] ## Show the linespreads in a single figure
ieFigure; %[output:0b355038]
xtick = -50:25:50;
ytick = xtick;

tiledlayout(2,2); %[output:0b355038]

for ii=1:4 %[output:group:0a55dc8e]
    nexttile; %[output:0b355038]
    imagesc(gca,support{ii}.x,support{ii}.y,rgb{ii});
    grid on;
    set(gca,'GridColor',[1 1 1],'GridLineWidth',1.2);
    set(gca,'xtick',xtick,'ytick',ytick);
    xlabel('um'); ylabel('um');
end %[output:group:0a55dc8e]
%%
